import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'
import Typing from 'react-typing-animation';

class TitleText extends Component {

  constructor( props )
  {

    super( props );

  }

  getTyping()
  {

    let { typing_arr_descriptions } = this.props;

    if( typing_arr_descriptions && typing_arr_descriptions != undefined ){

      return(
        <Typing loop={true}
                speed={25} >
        {
          typing_arr_descriptions.map( function( description ){

            return (
              <div>
                <span data-description-typing>{ description }</span>
                <Typing.Delay ms={2000} />
                <Typing.Backspace count={ description.length + 1 } />
              </div>
            );

          })
        }
        </Typing>
      );

    } else {
      return( <span></span> );
    }

  }

  render() {

    let { title, typing_arr_descriptions } = this.props;
    return (
      <div data-component="cover-page">

        <div className="container-page hidden">

          <p data-title dangerouslySetInnerHTML={{ __html: title }} />

          {this.getTyping()}

        </div>
      </div>
    );
  }
}
export default TitleText;
